	private static void renameTo(File file, String currentFilename, String tgtName, String newName) {
		currentFilename = currentFilename.replace(tgtName, "");
		currentFilename = currentFilename.replace("_._..","");
		currentFilename = currentFilename.replace("_._.","");
		file.renameTo(new File(currentFilename+"_._."+newName));
//		file.renameTo(new File(currentFilename.replace(tgtName, newName)));
	}
	private static void addNewFileType(HashMap<String, Integer> fileTypesCount, String key, File file) {
		if(fileTypesCount.get(key)==null){
			fileTypesCount.put(key, 1);
		}else{
			int value = fileTypesCount.get(key);
			value++;
			if(value>10){
				System.out.println(value+" : "+key+" "+file.getAbsolutePath());
			}
			fileTypesCount.put(key, value);
		}
	}
